// HasMapping applies the HasEdge predicate on the "mapping" edge.
func HasMapping() predicate.Posix {
	return predicate.Posix(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, MappingTable, MappingColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasMappingWith applies the HasEdge predicate on the "mapping" edge with a given conditions (other predicates).
func HasMappingWith(preds ...predicate.Mapping) predicate.Posix {
	return predicate.Posix(func(s *sql.Selector) {
		step := newMappingStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.Posix) predicate.Posix {
	return predicate.Posix(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.Posix) predicate.Posix {
	return predicate.Posix(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.Posix) predicate.Posix {
	return predicate.Posix(sql.NotPredicates(p))
}
